-- ----------------------------
-- Table structure for cms_article
-- ----------------------------
DROP TABLE IF EXISTS `cms_article`;
CREATE TABLE `cms_article`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `parent_id` bigint(20) NULL DEFAULT NULL COMMENT '所属社区的id',
  `user` bigint(20) NULL DEFAULT NULL COMMENT '用户id，外键',
  `catalog` mediumint(9) NULL DEFAULT NULL,
  `title` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标题',
  `keywords` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关键字',
  `description` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '描述',
  `content` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '内容',
  `click_num` mediumint(9) NULL DEFAULT 0 COMMENT '点击量',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '发表日期',
  `publish_type` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发布的类型，资讯或者社区',
  `is_del` tinyint(1) NULL DEFAULT 1 COMMENT '逻辑删除，1正常，0删除',
  `cover_image` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '文章封面图片',
  `status` tinyint(4) NULL DEFAULT NULL COMMENT '状态',
  `type_id` bigint(20) NULL DEFAULT NULL COMMENT '类型id',
  `recommended` tinyint(1) NULL DEFAULT NULL COMMENT '是否推荐	',
  `update_time` datetime(0) NULL DEFAULT NULL,
  `is_hot` tinyint(3) NULL DEFAULT 0 COMMENT '是否热门',
  `sort` int(10) NULL DEFAULT 0 COMMENT '排序',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 12 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '社区文章表' ROW_FORMAT = Dynamic;

