-- ----------------------------
-- Table structure for cms_comment
-- ----------------------------
DROP TABLE IF EXISTS `cms_comment`;
CREATE TABLE `cms_comment`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) NOT NULL COMMENT '评论人id',
  `parent_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '父评论id',
  `type` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1：文章评论',
  `aid` int(10) NOT NULL COMMENT '文章id',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '内容',
  `date` int(10) NOT NULL DEFAULT 0 COMMENT '评论日期',
  `status` tinyint(1) NOT NULL COMMENT '1:已审核 0：未审核',
  `is_delete` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否删除',
  `floor` int(10) NULL DEFAULT NULL,
  `create_time` datetime(0) NULL DEFAULT NULL,
  `remark` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注（审核不通过时添加）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '文章-评论表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of cms_comment
-- ----------------------------

-- ----------------------------
-- Table structure for cms_community
-- ----------------------------
DROP TABLE IF EXISTS `cms_community`;
CREATE TABLE `cms_community`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `type` tinyint(4) NULL DEFAULT NULL COMMENT '社区的类型，0游戏社区，1本站社区，2系统文章',
  `name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '社区名',
  `sort` int(11) NULL DEFAULT 0,
  `parent_id` bigint(20) NULL DEFAULT NULL COMMENT '如果是游戏社区，则父id就是游戏的id，',
  `create_time` datetime(0) NULL DEFAULT NULL,
  `update_time` datetime(0) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '社区表' ROW_FORMAT = Dynamic;

